import React, {Component} from "react"
import styled from 'styled-components' 

class Projects extends Component {
  render(){
  return (
    <div>
      <h1>Projects/case study</h1>
      <CardContainer className = "first-card">
      <div class="card mb-3">
      <svg class="bd-placeholder-img card-img-top" width="100%" height="180" xmlns="http://www.w3.org/2000/svg" aria-label="Placeholder: Image cap" preserveAspectRatio="xMidYMid slice" role="img">
      <title>Placeholder</title>
      <rect width="100%" height="100%" fill="#868e96"/>
      <text x="50%" y="50%" fill="#dee2e6" dy=".3em">Image cap</text>
      </svg>

      <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">It's a broader card with text below as a natural lead-in to extra content. This content is a little longer.</p>
      <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
      <a href="#" class="btn btn-primary">Button</a>
      </div>

    </div>
  </CardContainer>

    </div>

    );

  }
}

export default Projects;
const CardContainer = styled.card`
.cards{
    padding-top: 3rem;
    padding-bottom: 3rem;

}`
